import React from 'react';
import axios from 'axios';

const User = ({users}) => (
  <div>
    <ul>
      { console.log(users)}
    </ul>
  </div>
);

User.getInitialProps = async () => {
  const response = await axios.get(
    'https://api.github.com/orgs/rocketseat/members'
    );

  return { users: response };
}

export default User;
